The game at hand Short-attention-span synopsis: Welp, Barrett does indeed seem to be the answer. Zeke the Streak. Routgers.
Pregame buzz: News that J.T. Barrett would be making his first start of the season gave the Rutgers game an almost “season opener” feel to it. It’s not often a fresh start comes on the heels of a 7-0 start, but this was it.
Worth the road trip? In the shadow of the Big Apple sits Piscataway, where the first college football game was played in 1869 (Rutgers defeated Princeton 6-4). So history-loving fans could dig their teeth into antiquity even as they were digging their chompers into New Yawk pizza and some of the best deli food in the world.
One-liner: College football was born at Rutgers. The Scarlet Knights nearly died there on Saturday night, too.
Just wondering: Will college football ever be a big-enough deal in the Land of Lady Liberty, where pro football is king? The atmosphere in High Point Solutions Stadium was something you’d find on fall Friday nights in Ohio. No, wait, even high-school football in the Buckeye State is more energized than this. You would think being so close to New York would mean Rutgers would have can’t-miss fan support.
The view How the team sees it: Hear that smooth humming sound. It’s not your refrigerator. It’s us.
How the pollsters will see it: Buckeyes made the team from outside New York look like New Yuck. Impressive.
How Buckeye Nation will see it: You know it’s a good night when Rutgers’ best tacklers are Ohio State receivers.
Urban dictionary What he said: “The most complete defensive performance.”
What it means: “Even after letting Rutgers wriggle off the hook at the end.”
If this were an HBO mafia show The Sopran-osu’s . In this episode, the Don (played by Urban Meyer), tells his guys to eliminate Rutgers by “outfitting” them in cement cleats.
They said it Your turn/the channel: Viewers noted ABC’s A-team of Kirk Herbstreit and Chris Fowler were rolling along until the name game got away from them late, when Fowler kept saying “Bell” for OSU running back Warren Ball. Viewers also did not appreciate Fowler’s FBI investigation of Zeke Elliott’s first-down run that set up the Buckeyes’ first touchdown. Oh, and viewer Susan Fargus noted how “Herbie is getting a head start on no-shave November.”
Numbers for dummies 28: consecutive Big Ten wins for the Buckeyes, one shy of the national record for consecutive conference wins (Florida State won 29 from 1992-95 in the Atlantic Coast Conference).
150: Career wins for Meyer
78: reporters who were sorely disappointed to learn that a report of pumpkin pie being available at halftime was in fact an evil lie.
On tap Bye-bye Buckeyes for the week. Next up: Minnesota on Nov. 7.
